import React from 'react';
import './Fation.css';
import Series from './Series/Series.js';

import VallomaByTwinklee1o1 from './Resource/Valloma_by_twinkle/1(1).jpg';
import VallomaByTwinklee1o2 from './Resource/Valloma_by_twinkle/1(2).jpg';
import VallomaByTwinklee2 from './Resource/Valloma_by_twinkle/2.jpg';
import VallomaByTwinklee3 from './Resource/Valloma_by_twinkle/3.jpg';
import VallomaByTwinklee4 from './Resource/Valloma_by_twinkle/4.jpg';
import VallomaByTwinklee5 from './Resource/Valloma_by_twinkle/5.jpg';
import VallomaByTwinklee6o1 from './Resource/Valloma_by_twinkle/6(1).jpg';
import VallomaByTwinklee6o2 from './Resource/Valloma_by_twinkle/6(2).jpg';

import walkWithMee1 from './Resource/walk_with_me/1.jpg';
import walkWithMee2 from './Resource/walk_with_me/2.jpg';
import walkWithMee3o1 from './Resource/walk_with_me/3(1).jpg';
import walkWithMee3o2 from './Resource/walk_with_me/3(2).jpg';
import walkWithMee4o1 from './Resource/walk_with_me/4(1).jpg';
import walkWithMee4o2 from './Resource/walk_with_me/4(2).jpg';
import walkWithMee5 from './Resource/walk_with_me/5.jpg';

import yellowe1o1 from './Resource/Yellow/1(1).jpg';
import yellowe1o2 from './Resource/Yellow/1(2).jpg';
import yellowe2 from './Resource/Yellow/2.jpg';
import yellowe3 from './Resource/Yellow/3.jpg';
import yellowe4o1 from './Resource/Yellow/4(1).jpg';
import yellowe4o2 from './Resource/Yellow/4(2).jpg';
import yellowe5o1 from './Resource/Yellow/5(1).jpg';
import yellowe5o2 from './Resource/Yellow/5(2).jpg';
import yellowe6 from './Resource/Yellow/6.jpg';
import yellowe7 from './Resource/Yellow/7.jpg';

const fashion = (props) => {
   
    var seriesArray = [];

    if(props.series)
        props.series.map(function(v,k){
            seriesArray.push(
                <Series key={k} click={props.click} app={props.app} series={v.series} description={v.description}/>
            );
        });

    return(
        <div className="fashion">
            {seriesArray}
        </div>
    );
};

export default fashion;
